import MyAbout from "../Pages/MyAbout";
import MyPageId from "../Pages/MyPageId";
import MyPosts from "../Pages/MyPosts";

export const routes = [
    {path:'/about' , element: MyAbout },
    {path:'/posts' , element: MyPosts },
    {path:'/posts/:id' , element: MyPageId },
    {path:'*' , element: MyPosts },
]
